import "./App.css";
import Menu from "./Assets/Components/Menu";
import Formulario from "./Assets/Components/Formulario";
import UseForm from "./Assets/Components/UseForm";
import ReviewForm from "./Assets/Components/ReviewForm";
import Thenks from "./Assets/Components/Thenks";

// Hooks
import { formUse } from "./hooks/formUse";

function App() {

  const { currentStep, currentComponents} = formUse();

  return (
    <div className="app">
      <Menu />
      <Formulario />
      <UseForm />
      <ReviewForm />
      <Thenks />
    </div>
  );
}

export default App;
